import React from "react";
import "./app.css"


const App = () => {
  const names = [
    {
      name: "Peter",
      Age: 31,
      addrress: "Alexandria",
      Phone: "000000",
    },
    {
      name: "John",
      Age: 21,
      addrress: "Alexandria",
      Phone: "000002",
    },
    {
      name: "Lara",
      Age: 1,
      addrress: "Alexandria",
      Phone: "0000003",
    },
  ];
  return (
    <div>
      <div className="cardWrraper">
      {names.map((name) => (
        <div className="card">
          <p>{`Name : ${name.name}`}</p>
          <p>{`Age : ${name.Age}`}</p>
          <p>{`addrress : ${name.addrress}`}</p>
          <p>{`Phone : ${name.name}`}</p>
        </div>
     ) )};
    </div>
    </div>
  );
};

export default App;
